    false,nt"url": null,nt"notes": "The National Wildlife Refuge System (NWRS)
    Planning Workbook contains the nine-step process that we 11 be used to plan lands
    administered by the NWRS. It has been developed specifically as an adjunct to the
    Refuge Manual and conforms to the refuge master planning objectives and policies
    stated in Chapter 5 RM l, "Master Planning". The basic purpose of the Planning
    Workbook is to provide the impetus and instructions for the long-range planning
    of individual refuges, resulting in the formulation of the refuge guidance documents
    referred to as "Master Plans".",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
